                proRTTrialOffer: '<div class="main"><h3>' + $.t("Your Personal Invitation to&nbsp;Go&nbsp;PRO Plus") + "</h3><p>" + $.t("For a limited time, were offering a <strong>FREE 1 month</strong> subscription of PRO Plus (no credit card required, no catches or hidden autobilling).") + "</p><p>" + $.t('Our PRO Plus users see amazing benefits. You get advanced trading opportunities using multi symbol statistical arbitrage techniques. <a href="/gopro/" target="_blank">Read more about PRO Plus features</a>.') + '</p><div class="big-buttons two-buttons"><a href="javascript://" class="big-button trial">' + $.t("Activate Offer and GO PRO") + '</a><a href="javascript://" class="big-button nothanks">' + $.t("No, thank you") + "</a></div></div>",
